"tr","languageName":{"simpleText":"Turkish"}},{"languageCode":"tk","languageName":{"simpleText":"Turkmen"}},{"languageCode":"uk","languageName":{"simpleText":"Ukrainian"}},{"languageCode":"ur","languageName":{"simpleText":"Urdu"}},{"languageCode":"ug","languageName":{"simpleText":"Uyghur"}},{"languageCode":"uz","languageName":{"simpleText":"Uzbek"}},{"languageCode":"ve","languageName":{"simpleText":"Venda"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamese"}},{"languageCode":"war","languageName":{"simpleText":"Waray"}},{"languageCode":"cy","languageName":{"simpleText":"Welsh"}},{"languageCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"wo","languageName":{"simpleText":"Wolof"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"uf2-bVO2D20","title":"Serba-serbi Kratom, Sempat Dilarang BNN, Kini Diprospek Pemerintah","lengthSeconds":"181","keywords":["Video","Video Berita","Harian Kompas","News","Aktual","Terkini","Terbaru","kratom","lagal","indonesia","bnn","Video Kompas","eksklusif","Berita Terkini","Viral","Berita terbaru","Trending","Populer","Berita Update","Top News","News Update","Berita Hari Ini","berita","berita viral","internasional","berita internasional","berita video","international","berita hari ini","portal berita","berita dunia"],"channelId":"UCovqoUzPm9_s6mMt9OiWKpA","isOwnerViewing":false,"shortDescription":"Tanaman kratom yang sempat dilarang Badan Narkotika Nasional (BNN) kini menjadi perhatian Istana. Presiden Joko Widodo memimpin rapat terbatas terkait rencana legalisasi, budidaya, dan nilai ekonomis tanaman kratom atau purik (Mitragyna speciosa) bersama sejumlah menteri di Istana Merdeka, Jakarta, Kamis (20/6/2024). Saat ini, harga kratom yang kerap dijadikan obat tradisional ini tengah anjlok di pasar ekspor. Harga pasarnya menurun drastis menjadi 2-5 dollar per unit, dari sebelumnya mencapai 30 dollar. Usai ratas, Kepala Kantor Staf Kepresidenan Moeldoko dan Menteri Pertanian Andi Amran Sulaiman menyebut soal rencana pemerintah terkait kratom ke depan.\n\nDalam catatan Kompas, pelarangan penggunaan kratom pernah mengacu pada Surat Edaran BPOM 2016. Di dalam ketentuan itu disebutkan, kratom mengandung alkaloid mitragynine yang pada dosis rendah mempunyai efek stimulan dan pada dosis tinggi memiliki efek sedatif narkotika atau penenang. Pada 2017, Komite Nasional Perubahan Penggolongan Narkotika dan Psikotropika menggolongkan tanaman kratom sebagai narkotika golongan I. Lalu, BNN memperkuat klasifikasi kratom narkotika golongan I pada 2019. Selanjutnya, BNN melakukan sosialisasi dan pencegahan bahaya kratom. \n\nDi Kabupaten Putussibau, Kalimantan Barat, kratom dibudidayakan secara luas sejak 2010. Sebelumnya, tanaman ini tumbuh liar di pinggir sungai dan di hutan. Di hulu Sungai Kapuas di sepanjang Nanga Embaloh hingga Putussibau, misalnya, bantaran sungai dipenuhi kratom. Adapun penduduk lokal Kalimantan menggunakan daun kratom Indonesia sebagai pereda nyeri. Di Amerika Serikat, daun kratom digunakan sebagai obat rekreasional dan sebagai opioid yang tersedia dalam bentuk ekstrak, bubuk, atau suplemen.\n\nBanyak orang menggunakan daun kratom untuk berbagai tujuan, tetapi Badan Pengawas Obat dan Makanan Amerika Serikat (FDA) telah melarang penggunaan daun kratom di beberapa negara bagian Amerika Serikat karena kekhawatiran tentang keamanan dan efek samping kratom yang, menurut penelitian sementara, dapat menyebabkan penarikan, kecanduan, anoreksia, dan lain-lain.\n\n#kratom\n#indonesia \n#jokowi \n#tanaman \n\n=====================================\n\nSimak kumpulan video berita Harian Kompas: https://klik.kompas.id/videoberita\n\nInfo langganan harian Kompas \u0026 www.kompas.id:\nhttps://komp.as/SpesialKompas59\n\nSubscr nDalam catatan Kompas, pelarangan penggunaan kratom pernah mengacu pada Surat Edaran BPOM 2016. Di dalam ketentuan itu disebutkan, kratom mengandung alkaloid mitragynine yang pada dosis rendah mempunyai efek stimulan dan pada dosis tinggi memiliki efek sedatif narkotika atau penenang. Pada 2017, Komite Nasional Perubahan Penggolongan Narkotika dan Psikotropika menggolongkan tanaman kratom sebagai narkotika golongan I. Lalu, BNN memperkuat klasifikasi kratom narkotika golongan I pada 2019. Selanjutnya, BNN melakukan sosialisasi dan pencegahan bahaya kratom. \n\nDi Kabupaten Putussibau, Kalimantan Barat, kratom dibudidayakan secara luas sejak 2010. Sebelumnya, tanaman ini tumbuh liar di pinggir sungai dan di hutan. Di hulu Sungai Kapuas di sepanjang Nanga Embaloh hingga Putussibau, misalnya, bantaran sungai dipenuhi kratom. Adapun penduduk lokal Kalimantan menggunakan daun kratom Indonesia sebagai pereda nyeri. Di Amerika Serikat, daun kratom digunakan sebagai obat rekreasional dan sebagai opioid yang tersedia dalam bentuk ekstrak, bubuk, atau suplemen.\n\nBanyak orang menggunakan daun kratom untuk berbagai tujuan, tetapi Badan Pengawas Obat dan Makanan Amerika Serikat (FDA) telah melarang penggunaan daun kratom di beberapa negara bagian Amerika Serikat karena kekhawatiran tentang keamanan dan efek samping kratom yang, menurut penelitian sementara, dapat menyebabkan penarikan, kecanduan, anoreksia, dan lain-lain.\n\n#kratom\n#indonesia \n#jokowi \n#tanaman \n\n=====================================\n\nSimak kumpulan video berita Harian Kompas: https://klik.kompas.id/videoberita\n\nInfo langganan harian Kompas \u0026 www.kompas.id:\nhttps://komp.as/SpesialKompas59\n\nSubscribe Youtube Harian Kompas: https://bit.ly/3bIgBY9\n\nIkuti media sosial Harian Kompas\n\nTwitter: /hariankompas\nFacebook: /\nInstagram: /hariankompas","commandRuns":[{"startIndex":2096,"length":7,"onTap":{"innertubeCommand":{"clickTrackingParams":"CKgCENzXBBgUIhMIv9H83-y8kgMVtZVmAh3CVyA3ygEENG20Aw==" rang Badan Narkotika Nasional (BNN) kini menjadi perhatian Istana. Presiden Joko Widodo memimpin rapat terbatas terkait rencana legalisasi, budidaya, dan nilai ekonomis tanaman kratom atau purik (Mitragyna speciosa) bersama sejumlah menteri di Istana Merdeka, Jakarta, Kamis (20/6/2024). Saat ini, harga kratom yang kerap dijadikan obat tradisional ini tengah anjlok di pasar ekspor. Harga pasarnya menurun drastis menjadi 2-5 dollar per unit, dari sebelumnya mencapai 30 dollar. Usai ratas, Kepala Kantor Staf Kepresidenan Moeldoko dan Menteri Pertanian Andi Amran Sulaiman menyebut soal rencana pemerintah terkait kratom ke depan.\n\nDalam catatan Kompas, pelarangan penggunaan kratom pernah mengacu pada Surat Edaran BPOM 2016. Di dalam ketentuan itu disebutkan, kratom mengandung alkaloid mitragynine yang pada dosis rendah mempunyai efek stimulan dan pada dosis tinggi memiliki efek sedatif narkotika atau penenang. Pada 2017, Komite Nasional Perubahan Penggolongan Narkotika dan Psikotropika menggolongkan tanaman kratom sebagai narkotika golongan I. Lalu, BNN memperkuat klasifikasi kratom narkotika golongan I pada 2019. Selanjutnya, BNN melakukan sosialisasi dan pencegahan bahaya kratom. \n\nDi Kabupaten Putussibau, Kalimantan Barat, kratom dibudidayakan secara luas sejak 2010. Sebelumnya, tanaman ini tumbuh liar di pinggir sungai dan di hutan. Di hulu Sungai Kapuas di sepanjang Nanga Embaloh hingga Putussibau, misalnya, bantaran sungai dipenuhi kratom. Adapun penduduk lokal Kalimantan menggunakan daun kratom Indonesia sebagai pereda nyeri. Di Amerika Serikat, daun kratom digunakan sebagai obat rekreasional dan sebagai opioid yang tersedia dalam bentuk ekstrak, bubuk, atau suplemen.\n\nBanyak orang menggunakan daun kratom untuk berbagai tujuan, tetapi Badan Pengawas Obat dan Makanan Amerika Serikat (FDA) telah melarang penggunaan daun kratom di beberapa negara bagian Amerika Serikat karena kekhawatiran tentang keamanan dan efek samping kratom yang, menurut penelitian sementara, dapat menyebabkan penarikan, kecanduan, anoreksia, dan lain-lain.\n\n#kratom\n#indonesia \n#jokowi \n#tanaman \n\n=====================================\n\nSimak kumpulan video berita Harian Kompas: https://klik.kompas.id/videoberita\n\nInfo langganan harian Kompas \u0026 www.kompas.id:\nhttps://komp.as/SpesialKompas59\n\nSubscribe Youtube Harian Kompas: https://bit.ly/3bIgBY9\n\nIkuti media sosial Harian Kompas\n\nTwitter: /hariankompas\nFacebook: /\nInstagram: /hariankompas","commandRuns":[{"startIndex":2096,"length":7,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCkQ3NcEGD8iEwi_0fzf7LySAxW1lWYCHcJXIDfKAQQ0bbQD","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/kratom","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUKCgZrcmF0b20YAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CCkQ3NcEGD8iEwi_0fzf7LySAxW1lWYCHcJXIDc="}},{"startIndex":2104,"length":10,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCgQ3NcEGEAiEwi_0fzf7LySAxW1lWYCHcJXIDfKAQQ0bbQD","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/indonesia","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUNCglpbmRvbmVzaWEYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CCgQ3NcEGEAiEwi_0fzf7LySAxW1lWYCHcJXIDc="}},{"startIndex":2116,"length":7,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCcQ3NcEGEEiEwi_0fzf7LySAxW1lWYCHcJXIDfKAQQ0bbQD","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/jokowi","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUKCgZqb2tvd2kYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CCcQ3NcEGEEiEwi_0fzf7LySAxW1lWYCHcJXIDc="}},{"startIndex":2125,"length":8,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCYQ3NcEGEIiEwi_0fzf7LySAxW1lWYCHcJXIDfKAQQ0bbQD","commandMetadata":{"webComma :4291027836,"overlayBackground":3425253384},"colorSampledDescriptionBodyText":{"content":"Tanaman kratom yang sempat dilarang Badan Narkotika Nasional (BNN) kini menjadi perhatian Istana. Presiden Joko Widodo memimpin rapat terbatas terkait rencana legalisasi, budidaya, dan nilai ekonomis tanaman kratom atau purik (Mitragyna speciosa) bersama sejumlah menteri di Istana Merdeka, Jakarta, Kamis (20/6/2024). Saat ini, harga kratom yang kerap dijadikan obat tradisional ini tengah anjlok di pasar ekspor. Harga pasarnya menurun drastis menjadi 2-5 dollar per unit, dari sebelumnya mencapai 30 dollar. Usai ratas, Kepala Kantor Staf Kepresidenan Moeldoko dan Menteri Pertanian Andi Amran Sulaiman menyebut soal rencana pemerintah terkait kratom ke depan.\n\nDalam catatan Kompas, pelarangan penggunaan kratom pernah mengacu pada Surat Edaran BPOM 2016. Di dalam ketentuan itu disebutkan, kratom mengandung alkaloid mitragynine yang pada dosis rendah mempunyai efek stimulan dan pada dosis tinggi memiliki efek sedatif narkotika atau penenang. Pada 2017, Komite Nasional Perubahan Penggolongan Narkotika dan Psikotropika menggolongkan tanaman kratom sebagai narkotika golongan I. Lalu, BNN memperkuat klasifikasi kratom narkotika golongan I pada 2019. Selanjutnya, BNN melakukan sosialisasi dan pencegahan bahaya kratom. \n\nDi Kabupaten Putussibau, Kalimantan Barat, kratom dibudidayakan secara luas sejak 2010. Sebelumnya, tanaman ini tumbuh liar di pinggir sungai dan di hutan. Di hulu Sungai Kapuas di sepanjang Nanga Embaloh hingga Putussibau, misalnya, bantaran sungai dipenuhi kratom. Adapun penduduk lokal Kalimantan menggunakan daun kratom Indonesia sebagai pereda nyeri. Di Amerika Serikat, daun kratom digunakan sebagai obat rekreasional dan sebagai opioid yang tersedia dalam bentuk ekstrak, bubuk, atau suplemen.\n\nBanyak orang menggunakan daun kratom untuk berbagai tujuan, tetapi Badan Pengawas Obat dan Makanan Amerika Serikat (FDA) telah melarang penggunaan daun kratom di beberapa negara bagian Amerika Serikat karena kekhawatiran tentang keamanan dan efek samping kratom yang, menurut penelitian sementara, dapat menyebabkan penarikan, kecanduan, anoreksia, dan lain-lain.\n\n#kratom\n#indonesia \n#jokowi \n#tanaman \n\n=====================================\n\nSimak kumpulan video berita Harian Kompas: https://klik.kompas.id/videoberita\n\nInfo langganan harian Kompas \u0026 www.kompas.id:\nhttps://komp.as/SpesialKompas59\n\nSubscribe Youtube Harian Kompas: https://bit.ly/3bIgBY9\n\nIkuti media sosial Harian Kompas\n\nTwitter: /hariankompas\nFacebook: /\nInstagram: /hariankompas","commandRuns":[{"startIndex":2096,"length":7,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCUQ3NcEGBgiEwi_0fzf7LySAxW1lWYCHcJXIDfKAQQ0bbQD","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/kratom","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUKCgZrcmF0b20YAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CCUQ3NcEGBgiEwi_0fzf7LySAxW1lWYCHcJXIDc="}},{"startIndex":2104,"length":10,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCQQ3NcEGBkiEwi_0fzf7LySAxW1lWYCHcJXIDfKAQQ0bbQD","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/indonesia","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUNCglpbmRvbmVzaWEYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CCQQ3NcEGBkiEwi_0fzf7LySAxW1lWYCHcJXIDc="}},{"startIndex":2116,"length":7,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCMQ3NcEGBoiEwi_0fzf7LySAxW1lWYCHcJXIDfKAQQ0bbQD","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/jokowi","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUKCgZqb2tvd2kYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CCMQ3NcEGBoiEwi_0fzf7LySAxW1lWYCHcJXIDc="}},{"startIndex":2125,"length":8,"onTap":{
